        fontSize: "14px", 
        margin: "0 0 8px 0", 
        color: "#1D1D1B",
    }

    const cardContent = {
        padding: "6px 8px"
    }

    const sizeStyle = { 
        fontWeight: "500",
        fontSize: "13px", 
        margin: "0 0 16px 0",
        color: "#979797",
    }
    const { newClothes, getNew } = useContext(newContext)
    useEffect(() => {
    getNew();
    }, []);
    return (
        <div className='container'>
                <h3 className='hit-main-title'>Новинки</h3>
                <div style={{display: "flex", flexWrap: "wrap" ,}}>
                    {newClothes.map((item) => (
                    <NewCard />
                    ))}
                </div>
            </div>
    );
};

export default New;
